 (778,'AREA 0 – EXTERIOR','Altos puntajes obtenidos en esta área, significan que a usted le gusta pasar la mayor parte del tiempo en el campo, en los bosques o en el mar. Le agrada cultivar plantas o cuidar a los animales, etc. En cambio, no se sentiría muy a gusto en una fábrica, en un laboratorio o en una oficina',20,1,'agrado del tipo corriente',58.9744,'ordninal',0,57,1,0,'2019-04-20 19:06:47','2019-04-20 19:06:47'),
 (779,'AREA 1 – MECANICA','Un alto puntaje en esta área, indica que usted tiene interés para trabajar con máquinas y herramientas, construir o arreglar objetos mecánicos, artefactos eléctricos, muebles, etc.',21,2,'agrado del tipo corriente',58.5714,'ordninal',0,57,1,0,'2019-04-20 19:06:47','2019-04-20 19:06:47'),
 (780,'AREA 2 – CALCULO','Lo poseen aquellas personas a quienes les gusta trabajar con números. Muchos ingenieros revelan también un marcado interés por las actividades relacionadas con el cálculo.',22,3,'agrado del tipo corriente',56.5217,'ordninal',0,57,1,0,'2019-04-20 19:06:47','2019-04-20 19:06:47'),
 (781,'AREA 3 – CIENTIFICA','Manifiestan este interés las personas que encuentran placer en investigar la razón de los hechos o de las cosas, en descubrir sus causas y en resolver problemas de distinta índole, por mera curiosidad científica y sin pensar en los beneficios económicos que puedan resultar de sus descubrimientos. El interés científico es de gran importancia en el ejercicio de muchas carreras profesionales, aun de aquéllas donde el móvil de la actividad puede ser de índole distinta al progreso de la ciencia.',23,4,'agrado del tipo corriente',56.0606,'ordninal',0,57,1,0,'2019-04-20 19:06:47','2019-04-20 19:06:47'),
 (782,'AREA 4 – PERSUASIVA','Lo poseen aquellas personas a quienes les gusta tratar con la gente, imponer sus puntos de vista, convencer a los demás respecto a algún proyecto, venderles un artículo, etc.',24,5,'agrado del tipo corriente',45.679,'ordninal',0,57,1,0,'2019-04-20 19:06:48','2019-04-20 19:06:48'),
 (783,'AREA 5 – ARTISTICA','Lo poseen las personas a quienes les agrada hacer trabajos de creación de tipo manual, usando combinaciones de colores, materiales, formas y diseños.',25,6,'agrado del tipo corriente',61.5385,'ordninal',0,57,1,0,'2019-04-20 19:06:48','2019-04-20 19:06:48'),
 (784,'AREA 6 – LITERARIA','Es propio de todos aquellos a quienes les gusta la lectura o encuentran placer en expresar sus ideas en forma oral o escrita.',26,7,'agrado del tipo corriente',30.7692,'ordninal',0,57,1,0,'2019-04-20 19:06:48','2019-04-20 19:06:48'),
