 (888,'AREA 6 – LITERARIA','Es propio de todos aquellos a quienes les gusta la lectura o encuentran placer en expresar sus ideas en forma oral o escrita.',26,7,'agrado del tipo corriente',48.7179,'ordninal',0,65,1,0,'2019-04-25 11:25:05','2019-04-25 11:25:05'),
 (889,'AREA 7- MUSICAL','Se sitúan aquí las personas que muestran un marcado gusto para tocar instrumentos musicales, cantar, bailar, leer sobre música, estudiar la vida de compositores famosos, asistir a conciertos, etc.',27,8,'agrado del tipo corriente',64.2857,'ordninal',0,65,1,0,'2019-04-25 11:25:06','2019-04-25 11:25:06'),
 (890,'AREA 8 – SERVICIO SOCIAL','Un alto puntaje en esta área indica un gran interés por servir a los demás: a los necesitados, enfermos, niños y ancianos.',28,9,'agrado del tipo corriente',46.875,'ordninal',0,65,1,0,'2019-04-25 11:25:06','2019-04-25 11:25:06'),
 (891,'AREA 9 – OFICINA','Es propio de las personas a quienes les gusta un tipo de trabajo de escritorio, que requiere exactitud y precisión',29,10,'agrado del tipo corriente',51.0204,'ordninal',0,65,1,0,'2019-04-25 11:25:06','2019-04-25 11:25:06'),
 (892,'AREA 0 – EXTERIOR','Altos puntajes obtenidos en esta área, significan que a usted le gusta pasar la mayor parte del tiempo en el campo, en los bosques o en el mar. Le agrada cultivar plantas o cuidar a los animales, etc. En cambio, no se sentiría muy a gusto en una fábrica, en un laboratorio o en una oficina',20,1,'agrado del tipo corriente',57.6923,'ordninal',0,66,1,0,'2019-04-25 11:26:31','2019-04-25 11:26:31'),
 (893,'AREA 1 – MECANICA','Un alto puntaje en esta área, indica que usted tiene interés para trabajar con máquinas y herramientas, construir o arreglar objetos mecánicos, artefactos eléctricos, muebles, etc.',21,2,'agrado del tipo corriente',48.5714,'ordninal',0,66,1,0,'2019-04-25 11:26:31','2019-04-25 11:26:31'),
 (894,'AREA 2 – CALCULO','Lo poseen aquellas personas a quienes les gusta trabajar con números. Muchos ingenieros revelan también un marcado interés por las actividades relacionadas con el cálculo.',22,3,'agrado del tipo corriente',52.1739,'ordninal',0,66,1,0,'2019-04-25 11:26:32','2019-04-25 11:26:32'),
 (895,'AREA 3 – CIENTIFICA','Manifiestan este interés las personas que encuentran placer en investigar la razón de los hechos o de las cosas, en descubrir sus causas y en resolver problemas de distinta índole, por mera curiosidad científica y sin pensar en los beneficios económicos que puedan resultar de sus descubrimientos. El interés científico es de gran importancia en el ejercicio de muchas carreras profesionales, aun de aquéllas donde el móvil de la actividad puede ser de índole distinta al progreso de la ciencia.',23,4,'agrado del tipo corriente',42.4242,'ordninal',0,66,1,0,'2019-04-25 11:26:32','2019-04-25 11:26:32'),
