 (29,'Artículo 01 Derecho y ciencias Políticas','<p>&nbsp;</p>\n\n<p>La representaci&oacute;n de la diosa Iustitia (literalmente justicia en lat&iacute;n) la muestra equipada con tres s&iacute;mbolos del derecho: la espada simboliza el poder coercitivo del Estado; la balanza simboliza el equilibrio entre los derechos de los litigantes; y la venda sobre los ojos representa la imparcialidad.1​</p>\n\n<p>El&nbsp;<strong>derecho</strong>&nbsp;es un orden normativo2​e&nbsp;institucional&nbsp;de la&nbsp;conducta&nbsp;humana&nbsp;en&nbsp;sociedad&nbsp;inspirado en postulados de&nbsp;justicia&nbsp;y&nbsp;certeza jur&iacute;dica.3​Su car&aacute;cter y contenido est&aacute; basado en las relaciones sociales en un determinado lugar y tiempo. El concepto del derecho es estudiado por la&nbsp;filosof&iacute;a del derecho. A lo largo de la historia&nbsp;juristas,&nbsp;fil&oacute;sofos&nbsp;y&nbsp;te&oacute;ricos&nbsp;del derecho han propuesto definiciones alternativas y distintas&nbsp;teor&iacute;as jur&iacute;dicas&nbsp;sin que exista consenso sobre su definici&oacute;n.</p>',1,'04-06-2018-22-29-44.png',0,0,'04-06-2018-22-32-50.pdf',1,'2018-06-04 22:29:44','2018-12-16 20:22:09',1,'impresion'),
