 (39,'El Derecho en la Actualidad','<p>En la actualidad la idea del Estado de derecho est&aacute; aceptada casi un&aacute;nimemente. Los defensores de los derechos humanos ven en el Estado de derecho una herramienta indispensable para evitar la discriminaci&oacute;n y el uso arbitrario de la fuerza. &iquest;C&oacute;mo influye la profunda y persistente desigualdad social y econ&oacute;mica en la integridad del Estado de derecho? El objetivo principal del presente ensayo es tratar de comprender los efectos de la polarizaci&oacute;n de la pobreza y de la riqueza en el sistema jur&iacute;dico, especialmente con relaci&oacute;n a uno de los ideales esenciales del Estado de derecho: que la ley y los responsables de la implementaci&oacute;n de dicho Estado de derecho traten a la gente con imparcialidad.</p>',2,'',1,0,'',1,'2018-10-07 22:28:45','2018-12-16 20:22:49',1,'');
