INSERT INTO `metodologiavocacionals` (`id`,`nombre`,`descripcion`,`descmostrar`,`activo`,`borrado`,`created_at`,`updated_at`,`user_id`) VALUES 
 (1,'INVENTARIO DE INTERESES Y PREFERENCIAS PROFESIONALES - REVISADO IPP-R','<p>Versi&oacute;n revisada y actualizada del IPP (Inventario de Intereses Profesionales). Se mantienen las caracter&iacute;sticas esenciales del IPP, principalmente la existencia de elementos de dos tipos: preferencias del sujeto respecto a profesiones y respecto a actividades.</p>\n\n<p>El cuestionario de Intereses y Preferencias Profesionales, IPP, eval&uacute;a las preferencias respecto a quince campos profesionales; distinguiendo entre las actividades o tareas que se desempe&ntilde;an dentro de cada profesi&oacute;n y la idea que la persona tiene de dicha profesi&oacute;n. Por esta raz&oacute;n se obtienen dos puntuaciones: AC (referida a la actividad) y PR (referida a la profesi&oacute;n).</p>','<p>En esta prueba se pide que indiques tus gustos y preferencias respecto a las frases que contiene este Cuadernillo.</p>\n\n<p>En las p&aacute;ginas siguientes se relacionan diversas actividades y profesiones. Lee atentamente cada frase y marca tu respuesta con una X en la Hoja de Respuestas siguiendo las indicaciones escritas en la parte superior de cada p&aacute;gina. Siempre debes anotar la contestaci&oacute;n en la l&iacute;nea que tenga el mismo n&uacute;mero de la pregunta que est&aacute;s respondiendo.</p>\n\n<p>Debes indicar tus preferencias prescindiendo de otras consideraciones tales como recursos econ&oacute;micos, capacidad para estudiar, posibilidades, prestigio o dinero que se espera obtener, etc.</p>\n\n<p>No hay respuestas correctas ni incorrectas puesto que en ellas se refleja, simplemente la opini&oacute;n o los intereses de cada persona.</p>\n\n<p>Procura contestar a todas las cuestiones marcando la respuesta que se te ocurra espont&aacute;neamente, sin detenerte demasiado y sin consultar con tus compa&ntilde;eros. Tus respuestas debes decidirlas t&uacute; mismo</p>',1,0,NULL,'2018-06-18 09:06:38',1),
 (2,'INVENTARIO DE INTERESES VOCACIONALES DE G.F. KUDER FORMA C','<p>Elaborada como un cuestionario o inventario de elecci&oacute;n forzada en triadas (168 en total, lo que hace un conjunto de 504 &iacute;tems), esta prueba permite localizar los intereses y preferencias del examinado en diez &aacute;reas generales o escalas de inter&eacute;s.</p>\n\n<p><strong>&Aacute;mbito de aplicaci&oacute;n:</strong>&nbsp;A partir de los 15 a&ntilde;os de edad; escolares de 4to. y 5to. de Secundaria y adultos. Baremos peruanos: Establecidos sobre una amplia muestra de escolares de ambos sexos del 5to de Secundaria de Lima metropolitana.</p>','<p>Adaptaci&oacute;n realizada en el Departamento de Psicolog&iacute;a de la Universidad de Chile por Arriagada y cols.; estandarizaci&oacute;n desarrollada por Fern&aacute;ndez B. y cols.; actualizaci&oacute;n de normas realizada por Wenk, E. y cols.</p>\n\n<p><strong>Tiempo de aplicaci&oacute;n:</strong>&nbsp;No hay l&iacute;mite de tiempo. La mayor&iacute;a de las personas lo completan desde 20 a 55 minutos.</p>',1,0,NULL,'2018-06-18 22:40:30',1);
