 (1,'Perfil Bajo Actividades, Bajo Profesiones','Se encuentran puntos bajos en toda la prueba en cuanto a actividades y puntos bajos en cuanto a todas las profesiones, por lo que el perfil debe ser evaluado con mayor detenimiento, puede deberse a desinterés en realizar la prueba o está sufriendo problemas emocionales.','Se encuentran puntos bajos en toda la prueba en cuanto a actividades y puntos bajos en cuanto a todas las profesiones, por lo que el perfil debe ser evaluado con mayor detenimiento, puede deberse a desinterés en realizar la prueba o está sufriendo problemas emocionales.',33,'2019-03-28 12:58:06','2019-03-28 12:58:07'),
