 (61,'Resultados Perfil KUDER - Resultados de Alumno Normal','<div class=\'col-md-12\'><p>Usted tiene muy altos Intereses Profesionales en el Área: <b>AREA 0 – EXTERIOR.</b></p>\n\n                    <p>Altos puntajes obtenidos en esta área, significan que a usted le gusta pasar la mayor parte del tiempo en el campo, en los bosques o en el mar. Le agrada cultivar plantas o cuidar a los animales, etc. En cambio, no se sentiría muy a gusto en una fábrica, en un laboratorio o en una oficina</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Ciencias del mar</li><li>Ecólogos</li><li>Geólogos</li><li>Ingenieros agrónomos</li><li>Ingenieros forestales</li><li>Ingenieros de minas</li><li>Ingenieros pesqueros</li><li>Oficiales de ejército, marina, aviación, policía</li><li>Profesores de educación física</li><li>Topógrafos</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 1 – MECANICA.</b></p>\n\n                    <p>Un alto puntaje en esta área, indica que usted tiene interés para trabajar con máquinas y herramientas, construir o arreglar objetos mecánicos, artefactos eléctricos, muebles, etc.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Aviadores</li><li>Electromecánicos</li><li>Físicos</li><li>Ingenieros civiles</li><li>Ingenieros electricistas</li><li>Ingenieros industriales</li><li>Ingenieros mecánicos</li><li>Ingenieros metalúrgicos</li><li>Ingenieros químicos</li><li>Ingenieros sanitarios</li><li>Tecnólogos mecánicos.</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 2 – CALCULO.</b></p>\n\n                    <p>Lo poseen aquellas personas a quienes les gusta trabajar con números. Muchos ingenieros revelan también un marcado interés por las actividades relacionadas con el cálculo.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Actuarios</li><li>Contadores públicos y auditores</li><li>Economistas</li><li>Estadísticos</li><li>Ingenieros de sistemas</li><li>Profesores de matemáticas</li><li>Programadores de computadoras</li><li>Tecnólogos en mercadeo</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 3 – CIENTIFICA.</b></p>\n\n                    <p>Manifiestan este interés las personas que encuentran placer en investigar la razón de los hechos o de las cosas, en descubrir sus causas y en resolver problemas de distinta índole, por mera curiosidad científica y sin pensar en los beneficios económicos que puedan resultar de sus descubrimientos. El interés científico es de gran importancia en el ejercicio de muchas carreras profesionales, aun de aquéllas donde el móvil de la actividad puede ser de índole distinta al progreso de la ciencia.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Antropólogos</li><li>Arqueólogos</li><li>Astrónomos</li><li>Bacteriólogos</li><li>Biólogos</li><li>Ingenieros electricistas</li><li>Ingenieros electrónicos</li><li>Ingenieros de alimentos</li><li>Médicos y cirujanos</li><li>Médicos veterinarios</li><li>Microbiólogos</li><li>Odontólogos</li><li>Psicólogos</li><li>Químicos</li><li>Químicos farmaceutas</li><li>Sociólogos</li><li>Técnicos</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 4 – PERSUASIVA.</b></p>\n\n                    <p>Lo poseen aquellas personas a quienes les gusta tratar con la gente, imponer sus puntos de vista, convencer a los demás respecto a algún proyecto, venderles un artículo, etc.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Agentes de publicidad</li><li>Comunicadores sociales</li><li>Editores</li><li>Juristas (Abogados, Jueces, Consejeros Jurídicos)</li><li>Maestros – Profesores</li><li>Vendedores</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 5 – ARTISTICA.</b></p>\n\n                    <p>Lo poseen las personas a quienes les agrada hacer trabajos de creación de tipo manual, usando combinaciones de colores, materiales, formas y diseños.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Arquitectos</li><li>Decoradores de interiores</li><li>Delineantes de arquitectura</li><li>Dibujantes</li><li>Escultores</li><li>Pintores</li><li>Técnicos en diseño textil</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 7- MUSICAL.</b></p>\n\n                    <p>Se sitúan aquí las personas que muestran un marcado gusto para tocar instrumentos musicales, cantar, bailar, leer sobre música, estudiar la vida de compositores famosos, asistir a conciertos, etc.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Actores y Actrices</li><li>Compositores</li><li>Directores de orquesta</li><li>Músicos</li><li>Profesores de música</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 8 – SERVICIO SOCIAL.</b></p>\n\n                    <p>Un alto puntaje en esta área indica un gran interés por servir a los demás: a los necesitados, enfermos, niños y ancianos.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Bibliotecarios</li><li>Consejeros vocacionales</li><li>Enfermeras (os)</li><li>Fonoaudiólogas</li><li>Fisioterapeutas</li><li>Médicos y Cirujanos</li><li>Odontólogos</li><li>Pedagogos (en general)</li><li>Psicólogos</li><li>Sacerdotes</li><li>Tecnólogos en educación preescolar</li><li>Terapeuta del lenguaje</li><li>Terapeuta ocupacional</li><li>Trabajadores sociales</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en el Área: <b>AREA 9 – OFICINA.</b></p>\n\n                    <p>Es propio de las personas a quienes les gusta un tipo de trabajo de escritorio, que requiere exactitud y precisión</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Almacenistas</li><li>Archivistas</li><li>Cajeros</li><li>Contadores</li><li>Mecanógrafos</li><li>Recepcionistas</li><li>Secretarias</li><li>Secretarias ejecutivas</li><li>Taquígrafos (as)</li><li>Tenedores de libros</li><ul></div>','<div class=\'col-md-12\'><p>Usted tiene muy altos Intereses Profesionales en el Área: <b>AREA 0 – EXTERIOR.</b></p>\n\n                    <p>Altos puntajes obtenidos en esta área, significan que a usted le gusta pasar la mayor parte del tiempo en el campo, en los bosques o en el mar. Le agrada cultivar plantas o cuidar a los animales, etc. En cambio, no se sentiría muy a gusto en una fábrica, en un laboratorio o en una oficina</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse muy bien en las siguientes carreras profesionales:</p><ul><li>Ciencias del mar</li><li>Ecólogos</li><li>Geólogos</li><li>Ingenieros agrónomos</li><li>Ingenieros forestales</li><li>Ingenieros de minas</li><li>Ingenieros pesqueros</li><li>Oficiales de ejército, marina, aviación, policía</li><li>Profesores de educación física</li><li>Topógrafos</li><ul></div><div class=\'col-md-12\'><p>Usted también tiene muy altos Intereses Profesionales en e