 (66,'Resultados Perfil KUDER - Resultados de Alumno Normal','<div class=\'col-md-12\'><p>Usted tiene altos Intereses Profesionales en el Área: <b>AREA 5 – ARTISTICA.</b></p>\n\n                    <p>Lo poseen las personas a quienes les agrada hacer trabajos de creación de tipo manual, usando combinaciones de colores, materiales, formas y diseños.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse bien y/o regularmente en las siguientes carreras profesionales:</p><ul><li>Arquitectos</li><li>Decoradores de interiores</li><li>Delineantes de arquitectura</li><li>Dibujantes</li><li>Escultores</li><li>Pintores</li><li>Técnicos en diseño textil</li><ul></div>','<div class=\'col-md-12\'><p>Usted tiene altos Intereses Profesionales en el Área: <b>AREA 5 – ARTISTICA.</b></p>\n\n                    <p>Lo poseen las personas a quienes les agrada hacer trabajos de creación de tipo manual, usando combinaciones de colores, materiales, formas y diseños.</p>\n\n                 <p>Por lo que según los resultados del TEST, podría desempeñarse bien y/o regularmente en las siguientes carreras profesionales:</p><ul><li>Arquitectos</li><li>Decoradores de interiores</li><li>Delineantes de arquitectura</li><li>Dibujantes</li><li>Escultores</li><li>Pintores</li><li>Técnicos en diseño textil</li><ul></div>',107,'2019-04-25 11:26:31','2019-04-25 11:26:33');
