INSERT INTO `reglas` (`id`,`descripcion`,`activo`,`borrado`,`modulovocacional_id`,`created_at`,`updated_at`,`user_id`) VALUES 
 (1,'<p>En cada frase debes marcar:</p>',1,0,1,'2018-06-18 22:00:43','2018-06-18 22:00:43',1),
 (2,'<p><strong>A</strong> para contestar <strong>ME GUSTA</strong></p>',1,0,1,'2018-06-18 22:02:05','2018-06-18 22:02:05',1),
 (3,'<p><strong>B </strong>para contestar<strong> ME ES INDIFERENTE O TENGO DUDAS</strong></p>',1,0,1,'2018-06-18 22:02:08','2018-06-18 22:28:04',1),
 (4,'<p><strong>C</strong> para contestar <strong>NO ME GUSTA</strong></p>',1,0,1,'2018-06-18 22:02:43','2018-06-18 22:28:15',1),
 (13,'<p><strong>D</strong> si no conoces esa actividad o profesi&oacute;n</p>',1,0,1,'2018-06-18 22:28:26','2018-06-18 22:28:26',1),
 (14,'<p>- Ud. ver&aacute; las alternativas y las respuestas de su elecci&oacute;n.</p>',1,0,5,'2018-06-18 22:44:24','2018-06-18 22:47:04',1),
 (15,'<p>- Observar&aacute; una serie de actividades agrupadas de a tres (tr&iacute;adas), que tienen como objetivo ayudarle a descubrir cu&aacute;les son sus preferencias para elegir una ocupaci&oacute;n. Esto no es un examen, por lo que no tiene respuestas correctas o incorrectas.</p>',1,0,5,'2018-06-18 22:45:32','2018-06-18 22:53:12',1),
 (16,'<p>- Lea las tres actividades de cada grupo: Decida entre las 3 actividades la que usted prefiere o le agrada m&aacute;s y la que le gusta menos. Marcar la que m&aacute;s le guste con un click en el recuadro de la izquierda de las opciones de marcado, y la que menos le guste con un click en el recuadro de la derecha de las opciones de marcado.</p>',1,0,5,'2018-06-18 22:48:25','2018-07-30 21:13:58',1),
 (17,'<p>- De esta manera Ud. deber&aacute; contestar sucesivamente todas las tr&iacute;adas del cuestionario, sin omitir ninguna. Al hacerlo, no se detenga mucho tiempo pensando por cu&aacute;l actividad decidirse: at&eacute;ngase a su primera reacci&oacute;n, a lo que le surja espont&aacute;neamente.</p>',1,0,5,'2018-06-18 22:53:50','2018-06-18 22:53:50',1),
 (18,'<p>- Algunas actividades implican cierta preparaci&oacute;n y aprendizaje, pero Ud. deber&aacute; hacer su elecci&oacute;n SUPONIENDO que posee la experiencia y los conocimientos necesarios para realizarla.</p>',1,0,5,'2018-06-18 22:54:22','2018-06-18 22:54:22',1),
 (19,'<p>- A veces Ud. puede encontrar que las tres actividades le son igualmente agradables o desagradables. En esos casos IGUAL DEBE ELEGIR una actividad y rechazar otra. NO DEJE NINGUNA TR&Iacute;ADA SIN CONTESTAR.</p>',1,0,5,'2018-06-18 22:55:10','2018-06-18 22:55:10',1),
 (20,'<p>- Si necesita corregir alguna respuesta, puede hacerlo antes de terminar y confirmar el test</p>',1,0,5,'2018-06-18 22:55:41','2018-06-18 22:55:50',1);
